import React, { useState } from 'react'
import { withRouter } from 'react-router';


export default withRouter(
  function First(props){

    const { history } = props

    const [list, setlist]=useState([
        {id:1,name:"Avital"},
        {id:2,name:"Oryia"},
        {id:3,name:"Moriya"},
        {id:4,name:"Tamar"},
        {id:5,name:"Noa"},
        {id:6,name:"Tsipora"},
        {id:7,name:"Efrat"}
    ])
    const [name, setname] = useState()
    const [password, setpassword] = useState()

    function submit()
    {
        if(list.filter(f => f.id==password && f.name==name).length>0)
            history.push('/home')
        else
        {
            alert("You are not connected...")
            history.push('/items')
        }
    }
    function changeName(v) {
        setname(v)
    }
    function changePassword(v) {
        setpassword(v)
    }

    return<>
    <input placeholder="הכנס שם" onChange={(e)=>changeName(e.target.value)}></input>
    <input placeholder="הכנס סיסמה" onChange={(e)=>changePassword(e.target.value)}></input>
    <button onClick={() => submit()}>שלח</button>
    </>
}
)
